function whatIsInAName(collection, source) {

  let keys = Object.keys(source);

  return collection.filter(
    function(obj) {
      for (let key of keys) {
        if (!obj.hasOwnProperty(key) || obj[key] !== source[key])
          return false;
      }
      return true;
    });




}

